import React from 'react';
import ProcedureImages from '../components/ProcedureImages';
import { PROCEDURE } from '../store';

class ProcedureImagesContainer extends React.PureComponent {

  render(){
    let images = []
    for (var i = 0; i < PROCEDURE.steps.length; i++) {
      let step = PROCEDURE.steps[i]
      if(step.visuals && step.visuals.length){
        images = [...images, ...step.visuals]
      }
    }
    return(
      <ProcedureImages images={images} />
    )
  }
}

export default ProcedureImagesContainer;
